// парсим Headers-> Session-Id
def headerValue = testRunner.testCase.getTestStepByName("GetUser").httpRequest.response.responseHeaders['Session-Id']
// Достаем значение Session-Id из массива
def headerValue1 = headerValue[0]
//  помещаем его в TestCase Property Session-Id
testRunner.testCase.setPropertyValue("Session-Id", headerValue1.toString())
//  помещаем его в TestSuite Property Session-Id
def project = testRunner.testCase.testSuite.project
project.getTestSuiteByName("GeoPositionApi TestSuite").setPropertyValue("Session-Id", headerValue1.toString())

